import React from "react";

function DoneButton({ doneHandler }) {
    return (
        <div className="p-2">
            <button className="btn btn-secondary" style={{marginRight:'8px'}} onClick={doneHandler}>
                Done
            </button>
        </div>
    );
};

export default DoneButton;
